import React, { useEffect, useState } from "react";
import { FetchRecipes } from "../../MockApi";
import rercipesData from "./recipesData.json";
import {
  GridList,
  GridListTile,
  Card,
  CardMedia,
  CardContent,
  CardActionArea,
  Typography,
  Divider,
} from "@material-ui/core";
import useStyles from "./styles";
import Rating from "@material-ui/lab/Rating";

function Recipes() {
  const classes = useStyles();
  const baseUri = "https://spoonacular.com/recipeImages/";

  useEffect(() => {
    async function getData() {
      //   FetchRecipes();
    }
    getData();
  }, []);

  return (
    <div>
      <div id="Grid-intro" className={classes.intro}>
        <Typography variant="h4" color="textPrimary">
          Recipes for All Tastes and Occasions
        </Typography>
      </div>
      <Divider />
      <div id="Grid-recipes">
        <GridList
          cellHeight={400}
          //   className={classes.gridList}
          cols={4}
        >
          {rercipesData.map((recipe) => (
            <GridListTile key={recipe.id}>
              {/* <img src={baseUri + recipe.image} alt={recipe.title} /> */}
              <Card className={classes.cards}>
                <CardActionArea>
                  <CardMedia
                    className={classes.media}
                    image={baseUri + recipe.image}
                    title={recipe.title}
                  />
                  <CardContent>
                    <Typography variant="body1" color="textPrimary">
                      {recipe.title}
                    </Typography>
                    <Rating name="read-only" value="5" readOnly />
                  </CardContent>
                </CardActionArea>
              </Card>
            </GridListTile>
          ))}
        </GridList>
      </div>
    </div>
  );
}

export default Recipes;
